import logo from './logo.svg';
import './App.css';
import React from "react";
import Video from "./Video";

function App() {
  return (
    <div>
      <h1>My Video App</h1>
      <Video src="https://www.youtube.com/watch?v=pCdnFOonFxw" width="340" height="160" title="My Video" description="Check out this video" />
    </div>
  );
}

export default App;
